	(252, '2020-06-15 06:10:40', 1, 'function vowel_count(str) {\r\n\r\nreturn str.match(/[aeiou]/gi).length;\r\n\r\n}\r\n\r\nconsole.log(vowel_count(\'The quick brown fox jumps over the lazy dog\'));\r\n', 107, '11\n', 'Write a JavaScript function to count the number of vowels in a given string', '2020-06-15 06:10:40', NULL),
	(253, '2020-06-15 06:11:00', 1, 'function thousands_separators(num)\r\n{\r\nvar num_parts = num.toString().split(".");\r\nnum_parts[0] = num_parts[0].replace(/\\B(?=(\\d{3})+(?!\\d))/g, ",");\r\nreturn num_parts.join(".");\r\n}\r\n\r\nconsole.log(thousands_separators(1000));\r\nconsole.log(thousands_separators(10000.23));\r\nconsole.log(thousands_separators(100000));\r\n', 108, '1,000\n10,000.23\n100,000\n', 'Write a JavaScript function to print an integer with commas as thousands separators', '2020-06-15 06:11:00', NULL),
	(254, '2020-06-15 06:11:32', 1, 'function min_date(all_dates) {\r\n	var min_dt = all_dates[0],\r\n	min_dtObj = new Date(all_dates[0]);\r\n	all_dates.forEach(function(dt, index)\r\n	{\r\n		if ( new Date( dt ) < min_dtObj)\r\n		{\r\n			min_dt = dt;\r\n			min_dtObj = new Date(dt);\r\n		}\r\n	});\r\n	return min_dt;\r\n}\r\n\r\nconsole.log(min_date([\'2015/02/01\', \'2015/02/02\', \'2015/01/03\']));\r\n\r\n', 109, '2015/01/03\n', 'Write a Javascript function to returns the minimum of the given dates', '2020-06-15 06:11:32', NULL),
	(255, '2020-06-15 06:11:53', 1, 'const date = new Date(\'2010-06-10\');\r\nconst dateTimeFormat = new Intl.DateTimeFormat(\'en\', { year: \'numeric\', month: \'short\', day: \'2-digit\' });\r\nconst [{ value: month },,{ value: day },,{ value: year }] = dateTimeFormat .formatToParts(date )\r\n\r\nconsole.log(`${day}-${month}-${year }`)\r\n', 110, '10-Jun-2010\n', 'In JavaScript how can I format a date object to print as 10 Jun 2010', '2020-06-15 06:11:53', NULL),
	(256, '2020-06-16 05:58:54', 20, 'let goodInput = "12:34";\r\n\r\nlet badInput = "12:345";\r\n\r\n \r\n\r\nlet regexp = /^\\d\\d:\\d\\d$/;\r\n\r\nconsole.log( regexp.test(goodInput) ); // true\r\n\r\nconsole.log( regexp.test(badInput) ); // false', 97, 'true\nfalse\n', 'To find whether the person is working or retired', '2020-06-16 05:58:54', NULL),
