	(168, '2020-05-04 10:59:23', NULL, 'import java.util.ArrayList;\r\nimport java.util.Collections;\r\nimport java.util.HashMap;\r\nimport java.util.List;\r\nimport java.util.Map;\r\nimport java.util.Map.Entry;\r\n\r\npublic class Question28APQ3 {\r\n\r\n	public static void main(String[] args) {\r\n\r\n		List<Integer> maxNumColl=new ArrayList<>();		\r\n		Map<Integer, List<Integer>> map=new HashMap<>();\r\n		List<Integer> list=new ArrayList<>();\r\n		list.add(56);\r\n		list.add(12);\r\n		list.add(45);\r\n		list.add(89);\r\n		list.add(29);\r\n		list.add(33);\r\n		\r\n		maxNumColl.add(Collections.max(list));\r\n		map.put(1324, list);\r\n		\r\n		List<Integer>list2=new ArrayList<>();\r\n		list2.add(25);\r\n		list2.add(39);\r\n		list2.add(51);\r\n		list2.add(88);\r\n		list2.add(22);\r\n		list2.add(73);\r\n		list2.add(88);\r\n		list2.add(11);\r\n		list2.add(41);\r\n		list2.add(61);\r\n		\r\n		maxNumColl.add(Collections.max(list2));\r\n		\r\n		map.put(5621,list2);\r\n		\r\n		List<Integer>list3=new ArrayList<>();\r\n		list3.add(189);\r\n		list3.add(67);\r\n		list3.add(72);\r\n		\r\n		maxNumColl.add(Collections.max(list3));\r\n		\r\n		map.put(3456,list3);\r\n		\r\n		List<Integer>list4=new ArrayList<>();\r\n		list4.add(50);\r\n		list4.add(82);\r\n		list4.add(121);\r\n		list4.add(150);\r\n		\r\n		maxNumColl.add(Collections.max(list4));\r\n		\r\n		map.put(6722,list4);\r\n		\r\n		List<Integer>list5=new ArrayList<>();\r\n		list5.add(59);\r\n		\r\n		maxNumColl.add(Collections.max(list5));\r\n		\r\n		map.put(7902,list5);\r\n		\r\n		int topMax=Collections.max(maxNumColl);\r\n		System.out.println("Max Value is: "+topMax);\r\n		\r\n		for(Entry<Integer,List<Integer>>obj:map.entrySet()) {\r\n			int key=obj.getKey();\r\n			List<Integer> values = obj.getValue();\r\n			for(Integer a:values) {\r\n				if(a==topMax) {\r\n					System.out.println("key is: "+key);\r\n					break;\r\n				}\r\n			}\r\n		}\r\n	}\r\n\r\n}\r\n', 61, 'Max Value is: 189\nkey is: 3456\n', '28 AP Q3 Please refer mail for details', 20, '2020-05-04 10:59:23'),
	(169, '2020-05-04 10:59:53', NULL, 'import java.util.Iterator;\r\nimport java.util.LinkedHashSet;\r\nimport java.util.Set;\r\n\r\npublic class Question28APQ4 {\r\n	\r\n	public static void main(String[] args) {\r\n		\r\n		int case1=0;\r\n		int case2=0;\r\n		\r\n		Set<String> set=new LinkedHashSet<>();\r\n		set.add("Hemant");\r\n		set.add("malayalam");\r\n		set.add("MalayalAM");\r\n		set.add("LIRil");\r\n		set.add("Kiran");\r\n		set.add("Pankaj");\r\n		set.add("MalayalAm");\r\n		\r\n		Iterator<String> itr1=set.iterator();\r\n		while(itr1.hasNext()) {\r\n			String str1=itr1.next();\r\n			StringBuffer sb1=new StringBuffer(str1);\r\n			String str2=sb1.reverse().toString();\r\n			if(str1.equals(str2)) {\r\n				case1++;\r\n			}\r\n		}\r\n		System.out.println("Case1 is: "+case1);\r\n		\r\n		Iterator<String> itr2=set.iterator();\r\n		while(itr2.hasNext()) {\r\n			String str1=itr2.next();\r\n			StringBuffer sb1=new StringBuffer(str1);\r\n			String str2=sb1.reverse().toString();\r\n			if(str1.toLowerCase().equalsIgnoreCase(str2.toLowerCase())) {\r\n				case2++;\r\n			}\r\n		}\r\n		System.out.println("Case2 is: "+case2);\r\n	}\r\n\r\n}\r\n', 62, 'Case1 is: 1\nCase2 is: 4\n', '28 AP Q4 Please refer mail for details', 20, '2020-05-04 10:59:53'),
