	(171, '2020-05-04 11:01:22', NULL, 'import java.util.Arrays;\r\n\r\npublic class Question27APQ5 {\r\n\r\n	public static void main(String[] args) {\r\n\r\n		String s1="A chain is only as strong as its weakest link";\r\n		s1=s1.trim().replaceAll("\\\\s+","");\r\n		System.out.println("Original String Format: ");\r\n		System.out.println(s1);\r\n		int mid=s1.length()/2;\r\n		String start=s1.substring(0,mid);\r\n		String end=s1.substring(mid,s1.length());\r\n        System.out.println("=======================================");\r\n		char[] s=start.toCharArray();\r\n		Arrays.sort(s);\r\n\r\n		String obj=String.valueOf(s);\r\n\r\n		char[] r=end.toCharArray();\r\n		Arrays.sort(r);\r\n		String r1=String.valueOf(r);\r\n		StringBuffer sb1=new StringBuffer(r1);\r\n		sb1.reverse();\r\n		System.out.println("Output String Format: ");\r\n		System.out.println(obj+"-"+sb1);\r\n\r\n	}\r\n\r\n}\r\n', 54, 'Original String Format: \nAchainisonlyasstrongasitsweakestlink\n=======================================\nOutput String Format: \nAaachiilnnoorsssty-wttsssnnlkkiigeeaa\n', '27 AP Q5  Please refer the mail', 20, '2020-05-04 11:01:22'),
