	(12, '2020-04-28 07:09:29', 'error: <identifier> expected', NULL, 'It is not proper to use FIVE loops and process the same set of numbers for example once you know the number is Prime it is also ODD then it can be stored appropriately', 49, 'Jaydeep', 5, 'vishwanath', 3, 'import java.util.ArrayList;\nimport java.util.HashMap;\nimport java.util.Iterator;\nimport java.util.List;\nimport java.util.Map;\nimport java.util.Random;\nimport java.util.Set;\n\n\npublic class QuestionOne {\n\n	public static void main(String[] args) {\n		// TODO Auto-generated method stub\n\n		List<Integer> list = new ArrayList<>();\n		int ar[] = new int[200];\n		Random random = new Random();\n		int a = 2;\n		int b = 201;\n\n		for (int i = 0; i < ar.length; i++) {\n			ar[i] = random.nextInt(b - a) + a;\n		}\n\n		for (int i = 0; i < ar.length; i++) {\n			list.add(ar[i]);\n		}\n\n		Map<String, List<Integer>> map = new HashMap<>();\n\n\n		List<Integer> even=new ArrayList<>();\n		for(Integer x:ar){\n			if(x%2==0){\n				even.add(x);\n			}\n		}\n\n		List<Integer> odd=new ArrayList<>();\n		for(Integer y:ar){\n			if(y%2!=0){\n				odd.add(y);\n			}\n		}\n\n		List<Integer> prime=new ArrayList<>();\n		int i=0,j=2;\n		for( i=0;i<ar.length;i++){\n			for( j=2;j<i;j++)\n				if(ar[i]%j==0)\n					break;\n			if(i==j){\n				prime.add(ar[i]);\n			}        \n\n		}\n\n		List<Integer> multipleFive =new ArrayList<>();\n		for(Integer b1:ar) {\n			if(b1%5==0) {\n				multipleFive.add(b1);\n			}\n		}\n\n		List<Integer> multipleFiveEight=new ArrayList<>();\n		for(Integer b2:ar) {\n			if(b2%7==0 && b2%8==0) {\n				multipleFiveEight.add(b2);\n			}\n		}\n\n		map.put("India",even);\n		map.put("Japan",odd);\n		map.put("Korea",prime);\n		map.put("USA",multipleFive);\n		map.put("Mexico",multipleFiveEight);\n\n		Set s=map.entrySet();\n		\n		Iterator itr=s.iterator();\n		while(itr.hasNext()) {\n			System.out.println(itr.next());\n		}\n		\n\n	}\n\n}', NULL, '2020-04-28 05:58:02', '27 AP Q3  Please refer the mail', 52, NULL, NULL, 3, 'JAVA'),
	(13, '2020-04-28 12:51:14', 'error: <identifier> expected', NULL, 'what will happen if the value of a = 195 and b = 208 ? OR a = .123  and b = .6526 ?', 49, 'Jaydeep', 5, 'vishwanath', 4, 'public class Question28Q1 {\n\n	public static void main(String[] args) {\n				\n		float a=1234.567f;\n		float b=1726.823f;\n		\n		Float a1=a;\n		Float b1=b;\n		\n		String s=a1.toString().substring(0,a1.toString().indexOf("."));\n		String s2=b1.toString().substring(0,b1.toString().indexOf("."));\n		\n		String sAfterOne=a1.toString().substring(a1.toString().indexOf(".")+1);\n		String sAfterTwo=b1.toString().substring(b1.toString().indexOf(".")+1);\n		\n		System.out.println(sAfterOne+"\\n"+sAfterTwo);\n		\n		int x=Integer.valueOf(sAfterOne);\n		int y=Integer.valueOf(sAfterTwo);\n		\n		int x1=Integer.valueOf(s);\n		int y1=Integer.valueOf(s2);\n		\n		if((x<250 || x>425 )&&(y<250 || y>425)) {\n			System.out.println("Result is: "+x*y);\n		}else {\n			System.out.println("Resut second is: "+x1*y1);\n		}\n\n	}\n\n}', NULL, '2020-04-28 11:39:57', '28 AP Q1 Please refer mail for details', 59, NULL, NULL, 3, 'JAVA'),
	(14, '2020-04-28 12:52:35', 'error: cannot find symbol', NULL, 'How this can be shortened using Lambda functions?', 49, 'Jaydeep', 5, 'vishwanath', 5, 'public class Question28APQ3 {\n\n	public static void main(String[] args) {\n		\n		List<Integer>maxNumberIneachcollections=new ArrayList<>();\n		\n		\n		Map<Integer,List<Integer>>map=new HashMap<>();\n		\n		List<Integer>list=new ArrayList<>();\n		list.add(56);\n		list.add(12);\n		list.add(45);\n		list.add(89);\n		list.add(29);\n		list.add(33);\n		\n		maxNumberIneachcollections.add(Collections.max(list));\n		\n		\n		map.put(1324,list);\n		\n		List<Integer>list2=new ArrayList<>();\n		list2.add(25);\n		list2.add(39);\n		list2.add(51);\n		list2.add(88);\n		list2.add(22);\n		list2.add(73);\n		list2.add(88);\n		list2.add(11);\n		list2.add(41);\n		list2.add(61);\n		\n		maxNumberIneachcollections.add(Collections.max(list2));\n		\n		map.put(5621,list2);\n		\n		List<Integer>list3=new ArrayList<>();\n		list3.add(189);\n		list3.add(67);\n		list3.add(72);\n		\n		maxNumberIneachcollections.add(Collections.max(list3));\n		\n		map.put(3456,list3);\n		\n		List<Integer>list4=new ArrayList<>();\n		list4.add(50);\n		list4.add(82);\n		list4.add(121);\n		list4.add(150);\n		\n		maxNumberIneachcollections.add(Collections.max(list4));\n		\n		map.put(6722,list4);\n		\n		List<Integer>list5=new ArrayList<>();\n		list5.add(59);\n		\n		maxNumberIneachcollections.add(Collections.max(list5));\n		\n		map.put(7902,list5);\n		\n//		System.out.println(map);\n		\n		int topMax=Collections.max(maxNumberIneachcollections);\n		\n//		System.out.println(topMax);\n		\n		for(Entry<Integer,List<Integer>>obj:map.entrySet()) {\n			int key=obj.getKey();\n			List<Integer> values = obj.getValue();\n			for(Integer a:values) {\n				if(a==topMax) {\n					System.out.println(key);\n					break;\n				}\n			}\n		}\n		\n		\n	}\n\n}\n', NULL, '2020-04-28 12:17:43', '28 AP Q3 Please refer mail for details', 61, NULL, NULL, 3, 'JAVA'),
	(15, '2020-04-28 12:54:32', 'error: cannot find symbol', NULL, 'why there is no result? just look in the result section above ?? even though you have used println', 49, 'Jaydeep', 5, 'vishwanath', 6, 'public class QuestionAPQ4 {\n\n	public static void main(String[] args) {\n		\n		int case1=0;int case2=0; \n		\n		Set<String>set=new LinkedHashSet<>();\n		set.add("Hemant");\n		set.add("malayalam");\n		set.add("MalayalAM");\n		set.add("LIRil");\n		set.add("Kiran");\n		set.add("Pankaj");\n		set.add("MalayalAm");\n		\n		Iterator<String>itr=set.iterator();\n		while(itr.hasNext()) {\n			String s1=itr.next();\n			StringBuffer sb1=new StringBuffer(s1);\n			String s2=sb1.reverse().toString();\n			if(s1.equals(s2)) {\n				case1++;\n			}\n		}\n		\n		Iterator<String>itr2=set.iterator();\n		while(itr2.hasNext()) {\n			String s1String=itr2.next();\n			StringBuffer sb1=new StringBuffer(s1String);\n			String s2=sb1.reverse().toString();\n			if(s1String.toLowerCase().equalsIgnoreCase(s2.toLowerCase())) {\n				case2++;\n			}\n			\n		}\n		\n		System.out.println("Case 1"+case1);\n		System.out.println("Case 2"+case2);\n\n	}\n\n}', NULL, '2020-04-28 12:44:36', '28 AP Q4 Please refer mail for details', 62, NULL, NULL, 3, 'JAVA'),
	(16, '2020-04-28 12:55:41', NULL, NULL, 'why is it printing case 11 and case 24 when the names are just less than 10 ??', 49, 'Jaydeep', 5, 'vishwanath', 7, 'import java.util.Iterator;\nimport java.util.LinkedHashSet;\nimport java.util.Set;\npublic class QuestionAPQ4 {\n\n	public static void main(String[] args) {\n		\n		int case1=0;int case2=0; \n		\n		Set<String>set=new LinkedHashSet<>();\n		set.add("Hemant");\n		set.add("malayalam");\n		set.add("MalayalAM");\n		set.add("LIRil");\n		set.add("Kiran");\n		set.add("Pankaj");\n		set.add("MalayalAm");\n		\n		Iterator<String>itr=set.iterator();\n		while(itr.hasNext()) {\n			String s1=itr.next();\n			StringBuffer sb1=new StringBuffer(s1);\n			String s2=sb1.reverse().toString();\n			if(s1.equals(s2)) {\n				case1++;\n			}\n		}\n		\n		Iterator<String>itr2=set.iterator();\n		while(itr2.hasNext()) {\n			String s1String=itr2.next();\n			StringBuffer sb1=new StringBuffer(s1String);\n			String s2=sb1.reverse().toString();\n			if(s1String.toLowerCase().equalsIgnoreCase(s2.toLowerCase())) {\n				case2++;\n			}\n			\n		}\n		\n		System.out.println("Case 1"+case1);\n		System.out.println("Case 2"+case2);\n\n	}\n\n}', 'Case 11\nCase 24\n', '2020-04-28 12:44:48', '28 AP Q4 Please refer mail for details', 62, NULL, NULL, 3, 'JAVA'),
	(17, '2020-04-29 06:24:12', NULL, NULL, 'This is not correct HashMap must have integer key but value must be array of numbers so if key is 100 values could be [56,112,25,78,99,110,100,44]  and so on hence redo this again', 70, 'Ashish', 5, 'vishwanath', 1, 'import java.util.*; \n  public class Hashmap\n { \n  \n   \n    public static <K extends Comparable<K>, V> Map.Entry<K, V> \n    getMaxEntryInMapBasedOnKey(Map<K, V> map) \n    { \n     \n        Map.Entry<K, V> entryWithMaxKey = null; \n  \n    \n        for (Map.Entry<K, V> currentEntry : map.entrySet()) { \n  \n            if ( \n  \n                entryWithMaxKey == null\n  \n                || currentEntry.getKey() \n                           .compareTo(entryWithMaxKey.getKey()) \n                       > 0) { \n  \n                entryWithMaxKey = currentEntry; \n            } \n        } \n  \n   \n        return entryWithMaxKey; \n    } \n\n    public static void print(Map<Integer, Integer> map) \n    { \n  \n        System.out.print("Map: "); \n  \n        if (map.isEmpty()) { \n            System.out.println("[]"); \n        } \n  \n        else { \n            System.out.println(map); \n        } \n    } \n\n    public static void main(String[] args) \n    { \n  \n        Map<Integer, Integer> map \n            = new HashMap<>(); \n        map.put(41, 108); \n        map.put(45, 304); \n        map.put(25, 200); \n        map.put(234, 304); \n        map.put(67, 677); \n  \n        print(map); \n  \n        System.out.println( \n            "highest value with highest key: "\n            + getMaxEntryInMapBasedOnKey(map)); \n    } \n} \n', 'Map: {67=677, 41=108, 25=200, 234=304, 45=304}\nhighest value with highest key: 234=304\n', '2020-04-28 11:48:02', '28 AP Q3 Please refer mail for details', 61, NULL, NULL, 3, 'JAVA'),
	(18, '2020-04-29 06:27:40', NULL, NULL, 'You have made many attempts determine whether it is prime or not', 70, 'Ashish', 5, 'vishwanath', 2, '\r\nimport java.util.Iterator;\r\nimport java.util.Set;\r\nimport java.util.ArrayList;\r\nimport java.util.HashSet;\r\n\r\npublic class PrimeNumbers {\r\nstatic void checkPrimeNumbers(Set<Integer> hs) {\r\nArrayList<Integer> PrimeNumbers= new ArrayList<>();\r\nArrayList<Integer> NonPrimeNumbers=new ArrayList<>();\r\nIterator<Integer> value = hs.iterator();\r\nwhile (value.hasNext()) {\r\nint n = (int) (value.next());\r\nint i, m = 0, flag = 0;\r\nm = n / 2;\r\nif (n == 0 || n == 1) {\r\nNonPrimeNumbers.add(n);\r\n} else {\r\nfor (i = 2; i <= m; i++) {\r\nif (n % i == 0) {\r\nNonPrimeNumbers.add(n);\r\nflag = 1;\r\nbreak;\r\n}\r\n}\r\nif (flag == 0) {\r\nPrimeNumbers.add(n);\r\n}\r\n}\r\n}\r\nSystem.out.println("Prime Number Array " +PrimeNumbers.toString());\r\nSystem.out.println("Non Prime Number Array " +NonPrimeNumbers.toString());\r\n}\r\n\r\npublic static void main(String args[]) {\r\nSet<Integer> hs = new HashSet<Integer>();\r\nhs.add(1);\r\nhs.add(13);\r\nhs.add(67);\r\ncheckPrimeNumbers(hs);\r\n\r\n}\r\n}', 'Prime Number Array [67, 13]\nNon Prime Number Array [1]\n', '2020-04-27 12:49:29', 'Write a program to read the numbers from hashset and check whether the number is prime or not prime and if it is prime store it in an array', 45, NULL, NULL, 3, 'JAVA'),
	(19, '2020-04-29 06:28:32', NULL, NULL, 'Why have you executed the code so many times?', 70, 'Ashish', 5, 'vishwanath', 3, '\r\nimport java.util.Iterator;\r\nimport java.util.Set;\r\nimport java.util.ArrayList;\r\nimport java.util.HashSet;\r\n\r\npublic class PrimeNumbers {\r\nstatic void checkPrimeNumbers(Set<Integer> hs) {\r\nArrayList<Integer> PrimeNumbers= new ArrayList<>();\r\nArrayList<Integer> NonPrimeNumbers=new ArrayList<>();\r\nIterator<Integer> value = hs.iterator();\r\nwhile (value.hasNext()) {\r\nint n = (int) (value.next());\r\nint i, m = 0, flag = 0;\r\nm = n / 2;\r\nif (n == 0 || n == 1) {\r\nNonPrimeNumbers.add(n);\r\n} else {\r\nfor (i = 2; i <= m; i++) {\r\nif (n % i == 0) {\r\nNonPrimeNumbers.add(n);\r\nflag = 1;\r\nbreak;\r\n}\r\n}\r\nif (flag == 0) {\r\nPrimeNumbers.add(n);\r\n}\r\n}\r\n}\r\nSystem.out.println("Prime Number Array " +PrimeNumbers.toString());\r\nSystem.out.println("Non Prime Number Array " +NonPrimeNumbers.toString());\r\n}\r\n\r\npublic static void main(String args[]) {\r\nSet<Integer> hs = new HashSet<Integer>();\r\nhs.add(88);\r\nhs.add(13);\r\nhs.add(67);\r\ncheckPrimeNumbers(hs);\r\n\r\n}\r\n}', 'Prime Number Array [67, 13]\nNon Prime Number Array [88]\n', '2020-04-27 12:50:11', 'Write a program to read the numbers from hashset and check whether the number is prime or not prime and if it is prime store it in an array', 45, NULL, NULL, 3, 'JAVA'),
