	(41, '2020-05-04 07:18:43', NULL, NULL, 'yes this is fine. it would have been good if the output would have been more descriptive', 18, 'Mehul Raj', 5, 'vishwanath', 6, 'import java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.HashMap;\nimport java.util.List;\nimport java.util.Map;\nimport java.util.Map.Entry;\n\npublic class Question28APQ3 {\n\n	public static void main(String[] args) {\n		\n		List<Integer>maxNumberIneachcollections=new ArrayList<>();\n		\n		\n		Map<Integer,List<Integer>>map=new HashMap<>();\n		\n		List<Integer>list=new ArrayList<>();\n		list.add(75);\n		list.add(99);\n		list.add(19);\n		list.add(36);\n		\n		maxNumberIneachcollections.add(Collections.max(list));\n		\n		\n		map.put(1324,list);\n		\n		List<Integer>list2=new ArrayList<>();\n		list2.add(25);\n		list2.add(39);\n		list2.add(51);\n		list2.add(88);\n		list2.add(22);\n		list2.add(73);\n		list2.add(88);\n		list2.add(11);\n		list2.add(41);\n		list2.add(61);\n		\n		maxNumberIneachcollections.add(Collections.max(list2));\n		\n		map.put(5621,list2);\n		\n		List<Integer>list3=new ArrayList<>();\n		list3.add(189);\n		list3.add(67);\n		list3.add(72);\n		\n		maxNumberIneachcollections.add(Collections.max(list3));\n		\n		map.put(3456,list3);\n		\n		List<Integer>list4=new ArrayList<>();\n		list4.add(50);\n		list4.add(82);\n		list4.add(121);\n		list4.add(150);\n		\n		maxNumberIneachcollections.add(Collections.max(list4));\n		\n		map.put(6722,list4);\n		\n		List<Integer>list5=new ArrayList<>();\n		list5.add(59);\n		\n		maxNumberIneachcollections.add(Collections.max(list5));\n		\n		map.put(7902,list5);\n	\n		int topMax=Collections.max(maxNumberIneachcollections);\n		\n		for(Entry<Integer,List<Integer>>obj:map.entrySet()) {\n			int key=obj.getKey();\n			List<Integer> values = obj.getValue();\n			for(Integer a:values) {\n				if(a==topMax) {\n					System.out.println(key);\n					break;\n				}\n			}\n		}\n		\n		\n	}\n\n}', '3456\n', '2020-04-30 08:18:32', '28 AP Q3 Please refer mail for details', 61, NULL, NULL, 3, 'JAVA'),
	(42, '2020-05-04 07:19:40', NULL, NULL, 'this use case is fine.....what are the other use cases which can be considered for this?', 18, 'Mehul Raj', 5, 'vishwanath', 7, 'import java.util.Iterator;\nimport java.util.LinkedHashSet;\nimport java.util.Set;\n\npublic class QuestionAPQ4 {\n\n	public static void main(String[] args) {\n		\n		int case1=0;int case2=0; \n		\n		Set<String>set=new LinkedHashSet<>();\n		set.add("Mehul");\n		set.add("Raj");\n		set.add("Kiran");\n		set.add("Ankit");\n		set.add("Ram");\n		set.add("Ankit");\n		set.add("Mayank");\n		\n		Iterator<String>itr=set.iterator();\n		while(itr.hasNext()) {\n			String s1=itr.next();\n			StringBuffer sb1=new StringBuffer(s1);\n			String s2=sb1.reverse().toString();\n			if(s1.equals(s2)) {\n				case1++;\n			}\n		}\n		\n		Iterator<String>itr2=set.iterator();\n		while(itr2.hasNext()) {\n			String s1String=itr2.next();\n			StringBuffer sb1=new StringBuffer(s1String);\n			String s2=sb1.reverse().toString();\n			if(s1String.toLowerCase().equalsIgnoreCase(s2.toLowerCase())) {\n				case2++;\n			}\n			\n		}\n		\n		System.out.println("Case1: "+case1);\n		System.out.println("Case2: "+case2);\n\n	}\n\n}', 'Case1: 0\nCase2: 0\n', '2020-04-30 08:20:49', '28 AP Q4 Please refer mail for details', 62, NULL, NULL, 3, 'JAVA'),
