	(85, '2020-05-04 11:06:05', '2020-05-04 11:06:05', 20, NULL, '# python program to check if x is a perfect square \r\nimport math \r\ndef isPerfectSquare(x): \r\n	s = int(math.sqrt(x)) \r\n	return s*s == x \r\ndef isFibonacci(n): \r\n	return isPerfectSquare(5*n*n + 4) or isPerfectSquare(5*n*n - 4) \r\n	\r\n# A utility function to test above functions \r\nfor i in range(1,11): \r\n	if (isFibonacci(i) == True): \r\n		print i,"is a Fibonacci Number"\r\n	else: \r\n		print i,"is a not Fibonacci Number "\r\n', 70, '1 is a Fibonacci Number\n2 is a Fibonacci Number\n3 is a Fibonacci Number\n4 is a not Fibonacci Number \n5 is a Fibonacci Number\n6 is a not Fibonacci Number \n7 is a not Fibonacci Number \n8 is a Fibonacci Number\n9 is a not Fibonacci Number \n10 is a not Fibonacci Number \n', 'Write a Python Program for How to check if a given number is Fibonacci number'),
