	(87, '2020-05-04 11:07:24', '2020-05-04 11:07:24', 20, NULL, '# Python3 Program to \r\n# find sum of square \r\n# of first n natural \r\n# numbers \r\n\r\n\r\n# Return the sum of \r\n# square of first n \r\n# natural numbers \r\ndef squaresum(n) : \r\n\r\n	# Iterate i from 1 \r\n	# and n finding \r\n	# square of i and \r\n	# add to sum. \r\n	sm = 0\r\n	for i in range(1, n+1) : \r\n		sm = sm + (i * i) \r\n	\r\n	return sm \r\n\r\n# Driven Program \r\nn = 5\r\nprint(squaresum(n)) \r\n\r\n# This code is contributed by Nikita Tiwari.*/ \r\n', 71, '55\n', 'Write a Python Program for Sum of squares of first n natural numbers'),
	(88, '2020-05-04 11:08:21', '2020-05-04 11:08:21', 20, NULL, '# Python program to determine whether the number is \r\n# Armstrong number or not \r\n\r\n# Function to calculate x raised to the power y \r\ndef power(x, y): \r\n	if y==0: \r\n		return 1\r\n	if y%2==0: \r\n		return power(x, y/2)*power(x, y/2) \r\n	return x*power(x, y/2)*power(x, y/2) \r\n\r\n# Function to calculate order of the number \r\ndef order(x): \r\n\r\n	# variable to store of the number \r\n	n = 0\r\n	while (x!=0): \r\n		n = n+1\r\n		x = x/10\r\n	return n \r\n\r\n# Function to check whether the given number is \r\n# Armstrong number or not \r\ndef isArmstrong (x): \r\n	n = order(x) \r\n	temp = x \r\n	sum1 = 0\r\n	while (temp!=0): \r\n		r = temp%10\r\n		sum1 = sum1 + power(r, n) \r\n		temp = temp/10\r\n\r\n	# If condition satisfies \r\n	return (sum1 == x) \r\n\r\n\r\n# Driver Program \r\nx = 153\r\nprint(isArmstrong(x)) \r\nx = 1253\r\nprint(isArmstrong(x)) \r\n', 73, 'True\nFalse\n', 'Write a Python Program to check Armstrong Number'),
	(89, '2020-05-04 11:09:18', '2020-05-04 11:09:18', 20, NULL, '# Python program to print all \r\n# prime number in an interval \r\n\r\nstart = 11\r\nend = 25\r\n\r\nfor val in range(start, end + 1): \r\n	if val > 1: \r\n		for n in range(2, val//2 + 2): \r\n			if (val % n) == 0: \r\n				break\r\n			else: \r\n				if n == val//2 + 1: \r\n					print(val) \r\n', 72, '11\n13\n17\n19\n23\n', 'Write a Python program to print all Prime numbers in an Interval'),
