	(101, '2020-05-05 06:59:28', '2020-05-05 06:59:28', 20, NULL, 'def Fibonacci( pos ):\r\n\r\n        #check for the terminating condition\r\n\r\n        if pos <= 1 :\r\n\r\n                #Return the value for position 1, here it is 0\r\n\r\n                return 0\r\n\r\n        if pos == 2:\r\n\r\n                #return the value for position 2, here it is 1\r\n\r\n                return 1\r\n\r\n \r\n\r\n        #perform some operation with the arguments\r\n\r\n        #Calculate the (n-1)th number by calling the function itself\r\n\r\n        n_1 = Fibonacci( pos-1 )\r\n\r\n        #calculation  the (n-2)th number by calling the function itself again\r\n\r\n        n_2 = Fibonacci( pos-2 )\r\n\r\n        #calculate the fibo number\r\n\r\n        n = n_1 + n_2\r\n\r\n        #return the fibo number\r\n\r\n        return n\r\n\r\n \r\n\r\n#Here we asking the function to calculate 5th Fibonacci\r\n\r\nnth_fibo = Fibonacci( 5 )  # change this to 7 and 3\r\n\r\n \r\n\r\nprint (nth_fibo)', 84, '3\n', 'QS6 Refer Mail'),
	(102, '2020-05-05 07:00:13', '2020-05-05 07:00:13', 20, NULL, 'name = \'Anand\'  # define name\r\n\r\n \r\n\r\n \r\n\r\ndef printVinay():\r\n\r\n   name = \'Vinay\'  # define name in function\r\n\r\n   print(\'printing from the def: \', name)  # print from function\r\n\r\n \r\n\r\n# the main function\r\n\r\nprint(\'printing from the main: \', name)  # print from the main\r\n\r\nprintVinay()  # call the function to print', 85, '(\'printing from the main: \', \'Anand\')\n(\'printing from the def: \', \'Vinay\')\n', 'QS7 Refer Mail'),
	(103, '2020-05-05 07:01:04', '2020-05-05 07:01:04', 20, NULL, 'var = 0\r\n\r\nname = \'Aroha\'\r\n\r\n \r\n\r\ndef function_outer():\r\n\r\n   # global var    ; no need to declare to call the value\r\n\r\n   name = \'Bangalore\'\r\n\r\n \r\n\r\n   def function_inner():\r\n\r\n       global var  # need to declare global to modify the value\r\n\r\n       name = \'outlet\'\r\n\r\n       var = 23\r\n\r\n       print(\'name :\',name, \', var :\', var)\r\n\r\n \r\n\r\n   print(\'name :\', name, \', var :\', var)\r\n\r\n   function_inner()\r\n\r\n \r\n\r\nprint(\'name :\', name, \', var :\', var)\r\n\r\nfunction_outer()', 86, '(\'name :\', \'Aroha\', \', var :\', 0)\n(\'name :\', \'Bangalore\', \', var :\', 0)\n(\'name :\', \'outlet\', \', var :\', 23)\n', 'QS8 Refer Mail'),
	(104, '2020-05-05 07:02:03', '2020-05-05 07:02:03', 20, NULL, 'def closureFunc(sum):\r\n\r\n   def nestedFunc():\r\n\r\n      # ... statements ..\r\n\r\n       print("Welcome To Closure ")\r\n\r\n       print("You have sent argument %s" % sum)\r\n\r\n   return nestedFunc\r\n\r\ngetting = closureFunc(12)\r\n\r\ndel closureFunc\r\n\r\ngetting()', 87, 'Welcome To Closure \nYou have sent argument 12\n', 'QS9 Refer Mail'),
	(105, '2020-05-05 07:02:55', '2020-05-05 07:02:55', 20, NULL, 'class Stack:\r\n\r\n    stack = []  # empty list\r\n\r\n    max_size = -1\r\n\r\n \r\n\r\n    def __init__(self, size=-1):  # defining maximum size in the constructor\r\n\r\n        self.max_size = size\r\n\r\n \r\n\r\n    def push(self, item):\r\n\r\n        if self.max_size == -1:  # if there is no limit in stack\r\n\r\n            self.stack.append(item)\r\n\r\n        elif len(self.stack) < self.max_size:  # if max limit not crossed\r\n\r\n            self.stack.append(item)\r\n\r\n        else:  # if max limit crossed\r\n\r\n            print(\'Can\\\'t add item. Stack limit is :\', self.max_size)\r\n\r\n            raise RuntimeError\r\n\r\n \r\n\r\n    def pop(self):\r\n\r\n        if len(self.stack) > 0:\r\n\r\n            temp = self.stack[-1]\r\n\r\n            self.stack.pop()\r\n\r\n            return temp\r\n\r\n        else:\r\n\r\n            print(\'stack is already empty.\')\r\n\r\n            raise IndexError\r\n\r\n \r\n\r\n    def top(self):\r\n\r\n        if len(self.stack) > 0:\r\n\r\n            return self.stack[-1]  # returns the last item\r\n\r\n        else:\r\n\r\n            print(\'stack is already empty.\')\r\n\r\n            raise IndexError\r\n\r\n \r\n\r\nstack = Stack()\r\n\r\nstack.push(1)  # push item 1\r\n\r\nstack.push(2)  # push item 2\r\n\r\nprint(\'Pop the last item :\', stack.pop())  # pop the top item\r\n\r\nprint(\'Current top item is :\', stack.top())  # current top item', 88, '(\'Pop the last item :\', 2)\n(\'Current top item is :\', 1)\n', 'QS10 Refer Mail'),
	(106, '2020-05-06 08:24:20', '2020-05-06 08:24:20', 20, NULL, 'num = 17;\r\n\r\n# To take input from the user\r\n#num = int(input("Enter a number: "))\r\n\r\n# prime numbers are greater than 1\r\nif num > 1:\r\n   # check for factors\r\n   for i in range(2,num):\r\n       if (num % i) == 0:\r\n           print(num,"is not a prime number")\r\n           print(i,"times",num//i,"is",num)\r\n           break\r\n   else:\r\n       print(num,"is a prime number")\r\n       \r\n# if input number is less than\r\n# or equal to 1, it is not prime\r\nelse:\r\n   print(num,"is not a prime number")', 89, '(17, \'is a prime number\')\n', 'Q1 May 6  Pls refer mail Prime or not Prime'),
